const block3 = (item, index, context) => { return html`${ifDefined(item)}`; };
const block4 = (context) => { return html`${ifDefined(context.valueStateText)}`; };


const main = (context, tags, suffix) => {
	setTags(tags);
	setSuffix(suffix);
	return block0(context);
};

